// src/pages/ProductsPage.js
import React from 'react';
import './ProductsPage.css';
import pineconeImage from '../assets/pinecone.png';
import claudeImage from '../assets/claude.png';
import cognitiveImage from '../assets/cognitive.png';

const ProductSection = ({ title, subtitle, description, image }) => (
  <div className="product-section">
    <div className="product-text">
      <h2>{title}</h2>
      <p className="product-subtitle">{subtitle}</p>
      <p>{description}</p>
    </div>
    <div className="product-image">
      <img src={image} alt={title} />
    </div>
  </div>
);

const ProductsPage = () => (
  <div className="products-page">
    <ProductSection
      title="The Most Popular Vector Database — Now Serverless"
      subtitle="Pinecone"
      description="Build remarkable GenAI applications fast, with lower cost, better performance, and greater ease of use at any scale."
      image={pineconeImage}
    />
    <ProductSection
      title="Claude’s Capabilities"
      subtitle="Advanced Reasoning, Vision Analysis, and More"
      description="Claude can perform complex cognitive tasks beyond simple pattern recognition, including multilingual processing and code generation."
      image={claudeImage}
    />
    <ProductSection
      title="Controllable Cognitive Architecture for Any Task"
      subtitle="LangGraph Cognitive Framework"
      description="Supports diverse control flows with a flexible API, enabling multi-agent, hierarchical, and sequential processes."
      image={cognitiveImage}
    />
  </div>
);

export default ProductsPage;
